import { FaLaptopCode, FaPaintBrush, FaDatabase} from 'react-icons/fa'
import React, { Component } from 'react';

export const infoData = [

	{
		id: 1,
		icon: <FaPaintBrush/>,
		titl: 'Graphic Design',
		deta: 'Capture attention with beautiful, high-impact visuals. Create image manipulation effects and graphic design work for web, desktop, and mobile.'
		},
	{
		id: 2,
		icon: <FaLaptopCode/>,
		titl: 'Front-end',
		deta: 'Equipped with the unique skills needed to build and develop a variety of websites and applications. Constructing responsive websites using CSS, Flexbox and CSS Grid, develop interactive websites and UI (User Interface) applications using JavaScript and HTML, and connect a web application.'
		},
	{
		id: 3,
		icon: <FaDatabase/>,
		titl: 'Programming',
		deta: 'Builds Windows applications, web applications using Visual Studio.'
	  	}
]
